      <h2 class="t-section-heading">Company Information</h2>
      <div class="press__desc">
        <p class="t-body">DockYard is a user experience driven software consultancy. They design and engineer responsive web applications using JavaScript on the frontend and the functional, fault-tolerant programming language Elixir on the backend. Brian Cardarella founded DockYard in August 2011. Since that time, the Boston-based team has delivered products for clients ranging from ambitious startups to market-leading enterprises, and they have done so across a range of verticals.</p>
        <p class="t-body">DockYard is primarily a full service company that takes products from ideation to delivery. They believe in the marriage of design and engineering, proven by the constant collaboration between their in-house design and engineering teams. DockYard also offers staff augmentation services and training engagements. DockYard’s design and engineering services are equally expert and are never outsourced. DockYard has led, and in many cases created, the technologies now being used by many of the world’s largest software companies.</p>
      </div>
    </div>
